// Mysterious 'end()' bug -- caused by a lexer bug that interpreted '.e' as a number in scientific notation

test(function () {
  var l = caterwaul.lex;

  aeq(l('foo.bar()'), ['foo', '.', 'bar', '(', ')']);
  aeq(l('foo.e()'), ['foo', '.', 'e', '(', ')']);
  aeq(l('foo.end()'), ['foo', '.', 'end', '(', ')']);
});

